import React, { useState } from 'react';
import '../styles/Residents.css';

const Residents = () => {
  const [residents, setResidents] = useState([
    { id: 1, name: 'John Doe', email: 'john@example.com', houseNumber: 'A101' },
    { id: 2, name: 'Jane Smith', email: 'jane@example.com', houseNumber: 'B202' },
  ]);

  const [newResident, setNewResident] = useState({
    name: '',
    email: '',
    houseNumber: ''
  });

  const addResident = () => {
    setResidents([...residents, { ...newResident, id: residents.length + 1 }]);
    setNewResident({ name: '', email: '', houseNumber: '' });
  };

  return (
    <div className="residents-page">
      <h2>Residents</h2>
      <div className="resident-grid">
        {residents.map(resident => (
          <div key={resident.id} className="resident-card">
            <div className="resident-photo"></div>
            <div className="resident-details">
              <p>Name: {resident.name}</p>
              <p>Email: {resident.email}</p>
              <p>House No: {resident.houseNumber}</p>
            </div>
          </div>
        ))}
      </div>
      <div className="add-resident">
        <h3>Add Resident</h3>
        <input
          type="text"
          placeholder="Name"
          value={newResident.name}
          onChange={(e) => setNewResident({ ...newResident, name: e.target.value })}
        />
        <input
          type="email"
          placeholder="Email"
          value={newResident.email}
          onChange={(e) => setNewResident({ ...newResident, email: e.target.value })}
        />
        <input
          type="text"
          placeholder="House Number"
          value={newResident.houseNumber}
          onChange={(e) => setNewResident({ ...newResident, houseNumber: e.target.value })}
        />
        <button onClick={addResident}>Add Resident</button>
      </div>
    </div>
  );
};

export default Residents;
